import React from 'react'
import '../components/Header.css';
import Glone from "../assets/pexels-andrea-piacquadio-930705.jpg";
import Gltwo from "../assets/pexels-arley-bateca-3941260.jpg";
import Glthree from "../assets/pexels-cottonbro-4153152.jpg";
import Glfive from "../assets/pexels-curtis-adams-3288104.jpg";
import Glsix from "../assets/pexels-hakim-santoso-3634742.jpg";
import Glseven from "../assets/pexels-jean-van-der-meulen-1454804.jpg";
import Alone from "../assets/pexels-deeana-creates-2534572.jpg";
import Altwo from "../assets/pexels-joey-342800.jpg";
import Althree from "../assets/pexels-jonathan-borba-3316926.jpg";
import Alfive from "../assets/pexels-karolina-grabowska-4239013.jpg";
import Alsix from "../assets/pexels-ksenia-chernaya-4450337.jpg";
import Alseven from "../assets/pexels-markus-spiske-127726.jpg";
import Blone from "../assets/pexels-max-vakhtbovych-6032425.jpg";
import Bltwo from "../assets/pexels-max-vakhtbovych-6121091.jpg";
import Blthree from "../assets/pexels-max-vakhtbovych-6198654.jpg";
import Blfive from "../assets/pexels-max-vakhtbovych-6207818.jpg";
import Blsix from "../assets/pexels-max-vakhtbovych-6198661.jpg";
import Blseven from "../assets/pexels-max-vakhtbovych-6283974.jpg";


export default function Designerbathroom() {
  return (
    <div className="imgglry">
      <div class="row">
        <div class="col-lg-4 col-md-12 mb-4 mb-lg-0">
          <img
            src={Glone}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          // style={{ borderWidth: 2, borderColor: 'black', }}
          />

          <img
            src={Gltwo}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>

        <div class="col-lg-4 mb-4 mb-lg-0">
          <img
            src={Glthree}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />

          <img
            src={Glfive}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>

        <div class="col-lg-4 mb-4 mb-lg-0">
          <img
            src={Glsix}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />

          <img
            src={Glseven}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>
      </div>
      <div class="row">
        <div class="col-lg-4 col-md-12 mb-4 mb-lg-0">
          <img
            src={Alone}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          // style={{ borderWidth: 2, borderColor: 'black', }}
          />

          <img
            src={Altwo}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>

        <div class="col-lg-4 mb-4 mb-lg-0">
          <img
            src={Althree}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />

          <img
            src={Alfive}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>

        <div class="col-lg-4 mb-4 mb-lg-0">
          <img
            src={Alsix}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />

          <img
            src={Alseven}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>
      </div>
      <div class="row">
        <div class="col-lg-4 col-md-12 mb-4 mb-lg-0">
          <img
            src={Blone}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          // style={{ borderWidth: 2, borderColor: 'black', }}
          />

          <img
            src={Bltwo}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>

        <div class="col-lg-4 mb-4 mb-lg-0">
          <img
            src={Blthree}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />

          <img
            src={Blfive}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>

        <div class="col-lg-4 mb-4 mb-lg-0">
          <img
            src={Blsix}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />

          <img
            src={Blseven}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>
      </div>
    </div>
  )
}
